    let readBook=props.data

   
    return ( 
        <div className="readbooks">
            <div className="btn">
            <button onClick={()=>readBook(data.id,data.title)}>Readmore</button>
            </div>
            {readBook.map=(data=>{
                <div className="read">
                    <p>{data.longDescription}</p>
                </div>
            })}
        </div>

     );
}
 
export default ReadBooks;
